grid = [[None,None, 1 ,None,None],
        [None, 2 ,  3 ,  4 ,None],
        [  5 , 6 ,  7 ,  8 ,  9 ],
        [None,'A', 'B', 'C',None],
        [None,None,'D',None,None]]

normalize_list = [0,1,2,3,4]
direction = {'U':(-1,0),'D':(1,0),'L':(0,-1),'R':(0,1)}
answer = []
s_x, s_y = 0,2

secret_code = '''



'''.split('\n')

for each in secret_code:
    for every in each:
        t_x,t_y = min(normalize_list, key=lambda x:abs(x-(s_x+direction[every][0]))),min(normalize_list, key=lambda x:abs(x-(s_y+direction[every][1])))
        if grid[t_x][t_y]: 
            s_x, s_y = t_x,t_y
    answer.append(grid[s_x][s_y])
print(answer)
        
